import React from 'react'
import { LoremIpsum, Avatar } from 'react-lorem-ipsum';
import {useNavigate} from 'react-router-dom'
function Contactus()
{
  const x=useNavigate()
    return(
        <div className='text-center container'>
          <h1>Contact Us</h1>
          <img className="w-75" src="https://media.istockphoto.com/photos/-picture-id1311934969?b=1&k=20&m=1311934969&s=170667a&w=0&h=UQ3F8CE5zam5mT5swIliZ9nO7dhX4ZzsALMufFdv6Ys=" /> 
         {/* link to navigate to users component */}
         <button className= "btn btn-warning" onClick={()=>navigaet()}>
           Go to users
         </button>

        </div>
    )

    
}
export default Contactus
